  \"2016-07-27T23:03:18.048229\",\n\t\"name\": \"monitoring-the-stephens-kangaroo-rat-an-analysis-of-monitoring-methods-and-recommendations\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This document covers a series of analyses
  to explore and summarize previous monitoring efforts of Stephens Kangaroo Rats (SKR)
  and make recommendations for future monitoring and management. This report reviewed
  a large amount of data collected from 1989 - 2001 provided to us by USFWS. Data
  related to the estimation of population parameters at the scale of individual sites
  or trapping grids, and to the estimation of population trends across space and through
  time as it relates to understanding overall population trends within a reserve was
  analyzed. Next a series of recommendations regarding 1) a monitoring protocol for
  collecting data synchronously across all reserves for use in refining and updating
  a reserve-wide monitoring program and, 2) collecting additional information about
  biological processes/mechanisms responsible for SKR population dynamics, follows.\",\n\t\"license_title\":
